// Compute damage score for a sequence using GTDB likelihood ratios
inline float compute_gtdb_damage_score(const char* seq, size_t len) {
    if (len < 6) return 0.0f;
    
    extern uint32_t encode_hexamer(const char*);
    
    float score_5prime = 0.0f;
    float score_3prime = 0.0f;
    
    // Check 5' end (first 3 hexamers, position-weighted)
    for (int i = 0; i < 3 && i + 6 <= (int)len; i++) {
        uint32_t code = encode_hexamer(seq + i);
        if (code < 4096) {
            float weight = 1.0f / (1 << i);  // 1.0, 0.5, 0.25
            score_5prime += GTDB_DAMAGE_LLR_5PRIME[code] * weight;
        }
    }
    
    // Check 3' end (last 3 hexamers, position-weighted)
    for (int i = 0; i < 3 && i + 6 <= (int)len; i++) {
        size_t pos = len - 6 - i;
        uint32_t code = encode_hexamer(seq + pos);
        if (code < 4096) {
            float weight = 1.0f / (1 << i);
            score_3prime += GTDB_DAMAGE_LLR_3PRIME[code] * weight;
        }
    }
    
    return score_5prime + score_3prime;
}

